import Link from "next/link";
import fetch from "node-fetch";

export default function Test() {
  useEffect(() => {
    async function fetchData() {
      const res = await fetch("https://randomuser.me/api/");
      console.log(res.json());
    }
    fetchData();
  }, []);
  return (
    <div>
      <h4>This a test page</h4>
      <Link href="/">
        <a>back to home</a>
      </Link>
    </div>
  );
}

